import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './LoginPage';
import DashboardPage from './DashboardPage';
import AddEmployeePage from './AddEmployeePage';
import UpdateEmployeePage from './UpdateEmployeePage';
//import DeleteEmployeePage from './DeleteEmployeePage';

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<LoginPage />} />
                <Route path="/dashboard" element={<DashboardPage />} />
                <Route path="/add-employee" element={<AddEmployeePage />} />
                <Route path="/update-employee/:id" element={<UpdateEmployeePage />} />
               // <Route path="/delete-employee/:id" element={<DeleteEmployeePage />} />
            </Routes>
        </Router>
    );
}

export default App;
